parts:
{
  "ubx_class": "0x0a",
  "ubx_id": "0x02",
  "message_name": "UBX-MON-IO",
  "message_type": "periodic_polled",
  "description": "I/O system status",
  "payload_length": {
    "variable": {
      "formula": "N * 20",
      "description": "N = number of ports the receiver supports"
    }
  },
  "fields": [
    {
      "name": "ports",
      "data_type": {
        "array_of": {
          "fields": [
            {
              "name": "rxBytes",
              "byte_offset": 0,
              "data_type": "U4",
              "unit": "bytes",
              "description": "Number of bytes ever received"
            },
            {
              "name": "txBytes",
              "byte_offset": 4,
              "data_type": "U4",
              "unit": "bytes",
              "description": "Number of bytes ever sent"
            },
            {
              "name": "parityErrs",
              "byte_offset": 8,
              "data_type": "U2",
              "description": "Number of 100 ms timeslots with parity errors"
            },
            {
              "name": "framingErrs",
              "byte_offset": 10,
              "data_type": "U2",
              "description": "Number of 100 ms timeslots with framing errors"
            },
            {
              "name": "overrunErrs",
              "byte_offset": 12,
              "data_type": "U2",
              "description": "Number of 100 ms timeslots with overrun errors"
            },
            {
              "name": "breakCond",
              "byte_offset": 14,
              "data_type": "U2",
              "description": "Number of 100 ms timeslots with break conditions"
            },
            {
              "name": "reserved0",
              "byte_offset": 16,
              "data_type": {
                "array_of": "U1",
                "count": 4
              },
              "reserved": true,
              "description": "Reserved"
            }
          ]
        },
        "count": "N",
        "description": "Array of N port status structures (where N is the number of ports)"
      }
    }
  ]
}
